/**
* This function provides an interface to the College Adaptor to 
* retrieve Shared Application data from a staging table
* 
* @param &bindVars array of keys to retrieve from the staging table
* &bindVars[1]: teaching College's Mis Code
* &bindVars[2]: Application Id
* @Returns first matching row (if any), empty array if not found
*/
method getApplication
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 2 Then
      Error "bindVars should have 2 elements when getting shared application";
   End-If;

   Local string &teachMisCode = &bindVars [1];
   If None(&teachMisCode) Then
      Error "teachMisCode is required";
   End-If;

   Local string &appid = &bindVars [2];
   If None(&appid) Then
      Error "appid is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_SHARED_STG_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 1;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

/**
* This function provides an interface to the College Adaptor to 
* insert Shared Application data into a staging table
* 
* @param &bindVars array of data to insert into the staging table
* @Returns 2d array with rows affected in first row, first column
*/
method setApplication
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 310 Then
      Error "bindVars should have 310 elements when setting shared application";
   End-If;
   Local number &rowsAffected = 0;
   try
      Local SQL &sql = GetSQL(SQL.CCTC_SHARED_STG_SET, &bindVars);
      If &sql.Status <> %SQLStatus_OK And
            &sql.Status <> %SQLStatus_Duplicate Then
         Error String(&sql.Status);
      End-If;
      &rowsAffected = &sql.RowsAffected;
      &sql.Close();
   catch Exception &ex
      Error String(&ex.ToString( True));
   end-try;
   Return CreateArray(CreateArrayAny(&rowsAffected));

end-method;


